import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
  return (
    <nav className={"headerList"}>
      <NavLink exact activeClassName="active" to="/">
        Home
      </NavLink>
    </nav>
  );
}

export default NavBar;
